import axios from 'axios'

class ProductoService{
    backUrl = 'http://localhost:3700/'
    constructor(){
        this.res = []
    }

    getProductos = async () => {
        try{
            console.log('----------productos')
            const res = await axios.get(this.backUrl+'productos')
            this.res = res.data
        }
        catch(e){
            console.log(e)
        }
        return this.res
    }
}

export default ProductoService;
